import React from "react";
import styles from './myprojects.module.css';
import InfoCard from "./infocard";

const projects = [
    {
        icon:'',
        title:'Organica',
        info:'Frontend template for an ecommerce website',
        link:<a href="https://github.com/rafboah/Organic-Food-Ecommerce-Website" target="_blank">See more &#9205;</a> 
    },
    {
        icon:'',
        title:'Synthesia Connection',
        info:'Frontend template for an ecommerce website',
        link:<a href="https://github.com/rafboah/Synthesia_Connection" target="_blank">See more &#9205;</a>
    },
    {
        icon:'',
        title:'SmartCal',
        info:'Frontend template for an ecommerce website',
        link:<a href="https://github.com/rafboah/SmartCal" target="_blank">See more &#9205;</a>
    }
]

const MyProjects = () => {

    return(
        <div className={styles.myprojects}>
            <div>
                <h1>My<span>Services</span></h1>
            </div>
            {projects.map((project,index) => <InfoCard 
            key={index} item={project} iconClass={styles.icon} 
            titleClass={styles.title} infoClass={styles.info}
            linkClass={styles.link}/>)}
        </div>
    );
}

export default MyProjects;
